INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 2, 1, 24001, 1, 40011, 125801, "リリ", 0);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 2, 1, 24001, 2, 40011, 126001, "クリア", 0);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (323, "んーと。\nこれ、あげる。\nはい", 1, 2, 1, 24001, 3, 40011, 126101, "プレシア", 0);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 2, 2, 24001, 4, 40011, 125801, "リリ", 0);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 2, 2, 24001, 5, 40011, 126001, "クリア", 0);
INSERT INTO `v1_c5ec389c402aaf923661d643ba59f7241851d0a80979888451bbfa3e6bc519af` VALUES (326, "お兄。\nきてくれて、うれしい", 1, 2, 2, 24001, 6, 40011, 126101, "プレシア", 0);
